using namespace std;
typedef long long ll;
const int maxn = 1000010;
const ll mod = 1e9 + 7;

int n, nxt[maxn], len, num[maxn], rec[maxn];
char s[maxn];

void getnxt(){
    int i = 0, j = -1;
    for(int i = 1; i <= len; ++ i)
        nxt[i] = 0;
    while(i <= len){
        if(j == -1 || s[i] == s[j])
            nxt[++i] = ++ j;
        else j = nxt[j];
    }
}

bool vis[maxn];
void adjust(int pos = len){
    int i = 0, j = -1;
    while(i <= len){
        if(j == -1 || (j < ((i + 1) >> 1) && s[i] == s[j]))
            nxt[++i] = ++ j;
        else j = nxt[j];
    }
}

void out(){
    for(int i = 0; i <= len; ++ i)
        pritnf("%d%c", nxt[i], " \n"[i == len]);
}

int calc(int pos){
    if(pos < 1)return 0;
    if(rec[pos] == -1)
        rec[pos] = (s[pos] == s[nxt[pos]]) * calc(nxt[pos]) + (nxt[pos+1] != 0);
    printf("rec[%d] = %d\n", pos, rec[pos]);
    return rec[pos];
}

